import React from 'react';

function Selection() {
    return (
        <div className="col-sm-2">
            <h1>Exercise Combos <i class="fa fa-plus"></i></h1>
            <ul>
                <li><span className="plus"><i class="fa fa-plus"></i></span>Flat Bench and Single-arm Row</li>
                <li><span className="plus"><i class="fa fa-plus"></i></span>Shoulder Press and Squat Press</li>
                <li><span className="plus"><i class="fa fa-plus"></i></span>Curls and Tricep Extensions</li>
                <li><span className="plus"><i class="fa fa-plus"></i></span>a</li>
                <li><span className="plus"><i class="fa fa-plus"></i></span>a</li>
                <li><span className="plus"><i class="fa fa-plus"></i></span>a</li>
                <li><span className="plus"><i class="fa fa-plus"></i></span>a</li>
                <li><span className="plus"><i class="fa fa-plus"></i></span>a</li>
                <li><span className="plus"><i class="fa fa-plus"></i></span>a</li>
            </ul>
        </div> 
    )
    
}

export default Selection;
